(function(){Vue.component("convos-dialog-container",{props:["dialog","user"],mixins:[Convos.mixin.messages],methods:{resized:function(e){this.$els.main.style.bottom=this.$els.input.offsetHeight+"px";}},template:"<div :class=\"dialog.active ? &#39;active&#39; : &#39;&#39;\" class=\"convos-dialog-container\">\n    <main class=\"scroll-element\" v-el:main>\n      <component :dialog=\"dialog\" :is=\"&#39;convos-message-&#39; + msg.type\" :msg=\"msg\" :user=\"user\" v-for=\"msg in dialog.messages\" v-ref:messages></component>\n    </main>\n    <convos-input :dialog=\"dialog\" :user=\"user\" @resized=\"resized\" v-el:input></convos-input>\n  </div>\n"})})();